import java.time.LocalDate

class EventMarker(events: Seq[java.time.LocalDate], val periodInDay: Int, val name: String = "event", val maxProximity: Int = 30) extends Serializable {
import java.time.LocalDate
    import java.time.temporal._

    def getMarkers(localDate: LocalDate): Array[Double] = {
      var eventProximity = 0
      var eventProximityAfter = 0
      var eventInProgress = 0
      events.foreach(event => {
        val between = ChronoUnit.DAYS.between(localDate, event).toInt
        if (between >= 0 && between < maxProximity) {
          eventInProgress = periodInDay
          eventProximity = eventProximity max (maxProximity - between)
        }
        if (between < 0 && -1 * between < maxProximity) {
          eventProximityAfter = eventProximityAfter max (maxProximity + between)
        }
      })
      Array[Double](eventInProgress, eventProximity, eventProximityAfter)
    }
  }


  class EventMarkerTransformer(val eventMarker: EventMarker) extends org.apache.spark.ml.Transformer {
    import java.time._
    import org.apache.spark.ml.Transformer
    import org.apache.spark.ml.linalg.{SQLDataTypes, Vectors}
    import org.apache.spark.ml.param.ParamMap
    import org.apache.spark.sql.types._
    import org.apache.spark.sql.{DataFrame, Dataset}
    import org.apache.spark.sql.functions._
    import spark.implicits._

    def eventUdf(event: EventMarker) = udf{date: java.sql.Date => Vectors.dense(event.getMarkers(date.toLocalDate))}

    override def transform(dataset: Dataset[_]): DataFrame =  dataset.withColumn(s"event_${eventMarker.name}", eventUdf(eventMarker)($"time")).toDF()

    override def copy(extra: ParamMap): Transformer = new EventMarkerTransformer(eventMarker)

    override def transformSchema(schema: StructType): StructType = schema.add(s"event_${eventMarker.name}", SQLDataTypes.VectorType)

    override val uid: String = "eventTransformer"
  }
